import React, { Component } from "react";
import Select from "react-select";

const regions = require("philippines/regions");

export class signup extends Component {
  constructor(props) {
    super(props);
    this.state = {
      regions_api: {
        value: "",
        name: "",
      },
    };
  }

  render() {
    return (
      <div>
        <Select
          options={regions_api}
          onChange={HandleChangeRegion}
        />
      </div>
    );
  }
}

export default signup;
